insert into nestedkeyvalue VALUES ('UCP67696-1.0.0-Description-def', 'UCP67696-1.0.0-Description', 'A Music Pass csomaggal úgy hallgathatsz zenét a népszerű online zene applikációkon, hogy nem fogyasztod az adatkereted!  A Music Passben foglalt alkalmazások csak addig nem fogyasztják az adatkereted, amíg rendelkezel minimális adattal. A Music Pass belföldön és az EU-n belül érhető el, meghatározott applikációkra, személyi használatra, utazási célra, a tarifában foglalt vagy vásárolt kiegészítő adatopció erejéig. A Music Pass automatikusan megújul minden hónapban,így nem kell havonta újrarendelned. A Music Pass a zenei szolgáltatást nyújtó harmadik fél által havidíj ellenében elérhető prémium funkcióik elérését nem tartalmazza, ezen fizetős tartalmak igénybevételéhez külön előfizetés szükséges a zene szolgáltatónál.'); 
insert into nestedkeyvalue VALUES ('UCP67696-1.0.0-Description-eng', 'UCP67696-1.0.0-Description', 'A Music Pass csomaggal úgy hallgathatsz zenét a népszerű online zene applikációkon, hogy nem fogyasztod az adatkereted!  A Music Passben foglalt alkalmazások csak addig nem fogyasztják az adatkereted, amíg rendelkezel minimális adattal. A Music Pass belföldön és az EU-n belül érhető el, meghatározott applikációkra, személyi használatra, utazási célra, a tarifában foglalt vagy vásárolt kiegészítő adatopció erejéig. A Music Pass automatikusan megújul minden hónapban,így nem kell havonta újrarendelned. A Music Pass a zenei szolgáltatást nyújtó harmadik fél által havidíj ellenében elérhető prémium funkcióik elérését nem tartalmazza, ezen fizetős tartalmak igénybevételéhez külön előfizetés szükséges a zene szolgáltatónál.'); 
insert into nestedkeyvalue VALUES ('UCP67696-1.0.0-Description-hun', 'UCP67696-1.0.0-Description', 'Listen to your favourite music using  popular applications with our Music Pass package, without using your inbundle data. Applications in the Music Pass do not use your inbundle data only if you have minimal amount of inbundled or additional data. The Music Pass can be used in Hungary and in the EU for selected applications, for personal use and travel purposes only. The Music Pass can be used until inbundled or additional data is available. The Music Pass will be activated every month at the start of your billing period so you don''t have to worry about purchasing it! The Music Pass does not include premium features of the music service provider. Accessing the paid premium content requires a separate subscription with the music service provider.'); 
